import Header from '../components/Header';
import SignUp from '../components/SignUp';
import Footer from '../components/Footer';
import Links from '../components/InnerLinks/Links';
import innerLinksData from '../data/innerLinksData.json';
import { useRouter } from 'next/router'

import Head from 'next/head';
var localStorage = require('localStorage')
function InnerLinks(props) {
    const router = useRouter();
    console.log('router obj', router.query.name);
    localStorage.setItem("routes", router.query.name);
    return (
        <div>
            <Head>
                <link href="https://fonts.googleapis.com/css?family=Montserrat:300,400,500,600,700&display=swap" rel="stylesheet" /> 
                <link href="/static/style.css" rel="stylesheet" />
            </Head>
            <div className="wrapper">
                <Header />
                <Links linkObj={props.innerLinkObj} name={router.query.name}/>
                <SignUp />
                <Footer />
            </div>
        </div>
    )
}


export async function getStaticProps({}) {
    let innerLinkObj = innerLinksData;
    return {
        props: {
            innerLinkObj,
        },
    }
}

export default InnerLinks;
